import React from 'react';

export default function Servicios() {
  return (
    <div className="bg-gray-50 py-12">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="text-center">
          <h2 className="text-4xl font-bold tracking-tight text-gray-900">Descripción de los servicios:</h2>
          <p className="mt-4 text-xl text-gray-500">
          "Ofrecemos una amplia variedad de recetas y platillos disponibles para entrega en CDMX.
          <p>
            </p>
            <p>
          Nos especializamos en comida vegana y basada en plantas, utilizando solo los ingredientes más frescos y naturales."
          </p>
          </p>
        </div>
      </div>
    </div>
  );
}
